export const addMessage = message => {
    return {
        type: 'ADD_MESSAGE',
        payload: message,
    };
};

export const deleteMessage = messages => {
    return {
        type: 'DELETE_MESSAGE',
        payload: messages,
    };
};

export const updateDialog = dialog => {
    return {
        type: 'UPDATE_DIALOG',
        payload: dialog,
    };
};
